import logo from './logo.svg';
import './App.css';
import StoryPage from './components/StoryPage.js';
import React, { Grid, Box, useState, useEffect } from 'react';
const banana = require('@banana-dev/banana-dev');

function App() {
    const [prompt, setPrompt] = useState("");
    const [images, setImages] = useState([]);
    console.log(prompt)

    useEffect(() => {
      // update image list on page
    },[]);

    const generateImage = async (prompt) => {
      //call banana
      const out = await banana.run("48e6f984-4f85-4b8a-a2aa-6ade981c129e", "cee3a79a-7983-4f39-9974-9fce016fc809", {"prompt": prompt})
      //const b64 = out.modelOutputs[0].image_base64;
      //const b64 = ""
      //console.log(out)
      setImages([...images, {"text": prompt, "image": out.modelOutputs[0].image_base64}]);
    }

    return (
      <div>
          <input type="text" name="prompt" onChange={(e) => {setPrompt(e.target.value)}} />
          <button onClick={() => {generateImage(prompt)}}>
            Generate story page
          </button>
        {images.map((img) => { return (<p>{img['text']}<img src={"data:image/png;base64," + img['image']} /></p>)
        })}
        <section>
  <Grid container>
    <Grid item xs={12} md={6}>
      <Box py={10} display="flex" bgcolor="action.selected">
        <Box className={[classes.halfLg, classes.firstBox]}>
          <Container>
            <Typography variant="h4" component="h2" gutterBottom={true}>Let's talk about the future</Typography>
            <Typography variant="subtitle1" color="textSecondary" paragraph={true}>We're here to answer your questions and discuss the decentralized future of the internet.</Typography>

            <Box mt={4}>
              <Box display="flex">
                <RoomIcon className={classes.icon} />
                <Typography variant="body1" color="textSecondary" paragraph={true}>Pied Piper HQ - 59 Silicon Av.</Typography>
              </Box>
              <Box display="flex">
                <PhoneIcon className={classes.icon} />
                <Typography variant="body1" color="textSecondary" paragraph={true}>555-333-555</Typography>
              </Box>
              <Box display="flex">
                <EmailIcon className={classes.icon} />
                <Typography variant="body1" color="textSecondary" paragraph={true}>pay-the-piper@piedpiper.com</Typography>
              </Box>
            </Box>
          </Container>
        </Box>
      </Box>
    </Grid>
    <Grid item xs={12} md={6}>
      <Box py={10} display="flex" className={[classes.halfLg, classes.secondBox]}>
        <Container>
          <form noValidate>
            <Grid container spacing={2}>
              <Grid item xs={12}>
                <TextField variant="outlined" required fullWidth name="email" id="email" label="Email address" autoComplete="email" />
              </Grid>
              <Grid item xs={12}>
                <TextField variant="outlined" required multiline rows={5} fullWidth autoComplete="message" name="message" id="message" label="Message" />
              </Grid>
            </Grid>
            <Box mt={2}>
              <Button type="submit" fullWidth variant="contained" color="primary">
                Submit
              </Button>
            </Box>
          </form>
        </Container>
      </Box> 
    </Grid>
  </Grid>
</section>
      </div>
    );
}

export default App;
